var tipuesearch = {"pages": [{'title': '簡介', 'text': '在學期末前總共學了Onshape、V-rep操作、以及Github的管理，在本網頁終將會呈現本學期所學到的內容與實際操作的問題。在小組分組的主要任務中分配到手足球裡的送球機構設計與繪製，在繪製時對Onshape的使用上也有了不少心得。 \n \n', 'tags': '', 'url': '簡介.html'}, {'title': '學員出席', 'text': '整學期皆有到課且每周更新\xa0 (20%) \n 以下記錄了我在這學期裡所有的刷卡紀錄與推送紀錄，證明在每個禮拜確實到教室與組員進行每周的所排定的任務。 \n Github推送紀錄 \n \n 點名紀錄 \n \n \n \n', 'tags': '', 'url': '學員出席.html'}, {'title': 'Onshape 協同操作', 'text': '確實完成自己分配所繪製的工作並紀錄影片 (15%) \n 在繪圖部分由於本身就是在網路上作圖，所以對於成員在同一時間各自操作各自的甚至是一同修改同一個圖檔也沒問題，遇到修改馬上更新對於我們最直接的好處就是不會有衝突的問題發生。 \n 繪圖過程: \n \n 在匯出的過程需要注意圖檔需求，如果是STL的話有分成個別轉出或合併轉出，當在組合圖的部分設定個別轉出時會全部零件分開來，每個零件的原點會在個別的原點上，當用合併轉出時，將會在組合圖座標原點的相對位置。 \n 合併轉出丟入V-rep結果 \n \n 個別轉出丟入V-rep結果 \n \n', 'tags': '', 'url': 'Onshape 協同操作.html'}, {'title': 'V-rep 模擬', 'text': '完成送球機構V-rep模擬工作並學會如何簡化圖檔\xa0 (15%) \n 在完成繪圖的部分後，進行了自己的送球機構模擬。 \n \n 部分講解: \n 1.開啟旋轉軸 \n \n 2.將軸放在需要做旋轉的物件上並將分支樹裡相對應的物件放進軸裡。 \n \n 3.將物件設定干涉(如不需模擬或例如不動的本體就不需打開Body is dynamic) \n \n 4.設定球與撥桿時需要進行物理的參數 Body is dynamic就須開啟。 \n \n 5.如發現撥桿的轉速太慢可修改轉速，而球的重量太重可以修改撥桿軸的扭力。 \n \n 6.之後發現模擬呈現不順時，修改元件的簡化程度。 \n \n 7.用來調整元件的簡化程度，越簡化越能提升電腦運算的效率，但簡化太多易造成模擬瑕疵 \n \n \n', 'tags': '', 'url': 'V-rep 模擬.html'}, {'title': 'Github 倉儲管理', 'text': '確實每周持續更新小組\xa0 (15%) \n 第三組分組倉儲: https://github.com/mdekmol/cd2019a-task1-2019cda_t1_g3_1 \n 在分組的倉儲裡每周持續更新內容上去，十六周將東西整理好更新最後成果上去。 \n \n 組長Fork倉儲: https://github.com/40623128/cd2019a \n 除了剛建立時，試推了東西確認沒問題，接下來就等全部任務結束後進行最後的推送而確定沒問題後交由組長與班級網頁做推送的工作。 \n \n 協同產品設計個人倉儲: https://github.com/40623156/56CC \n', 'tags': '', 'url': 'Github 倉儲管理.html'}, {'title': '程式開發', 'text': '無參與程式開發 (0%) \n 程式開發的部分因參與的時間太晚，所以學的東西並沒有像V-rep模擬與Onshape來的那麼深入，經詢問同學後僅看得懂參數修改。 \n \n', 'tags': '', 'url': '程式開發.html'}, {'title': '心得', 'text': '這學期的十人分組已不是上學期的五人分組那麼簡單，在分配個人任務越來越細，此時自己的想法如何被大家都能接受就要費很大的心思，在製圖的尺寸修改小問題都很容易解決，但在經過期中的V-rep一步一步的教學後，突然要丟個小組設計的東西進行模擬還是需要組員的互相指導，對於PDF製作的問題也遇到很多問題，很感謝遇到了一群很有耐心組員互相幫忙，大家一起合作才有一份成功的報告。 \n', 'tags': '', 'url': '心得.html'}, {'title': '期末影片', 'text': '國立虎尾科技大學 - 機械設計工程系 - 協同產品設計實習期末報告 - 40623156 - 林聖翰 \n \n \n', 'tags': '', 'url': '期末影片.html'}, {'title': '自評分數', 'text': '學員出席20% \n Onshape 協同操作15% \n V-rep模擬15% \n Github倉儲管理15% \n 程式開發0% \n 實拿分數65% \n', 'tags': '', 'url': '自評分數.html'}, {'title': '期末測驗', 'text': '期末作業-彈珠檯 \n \n 彈珠檯檔案請點這! \n 彈珠檯程式請點這!', 'tags': '', 'url': '期末測驗.html'}]};